// Filename - components/array.js
 
// Javascript object named array 
// with 3 key-values
const array = [
  {
      id: "1",
      Name: "Ion",
      Age: "60",
      Salary: "1500",
  },
  {
      id: "2",
      Name: "Marcel",
      Age: "22",
      Salary: "4000",
  },
  {
      id: "3",
      Name: "Luca",
      Age: "20",
      Salary: "3450",
  },
  {
    id: "4",
    Name: "Zoro",
    age: "55",
    Salary: "15000",
  },
  {
    id: "5",
    Name: "Andreea",
    age: "18",
    Salary: "500",
  }
];

export default array;
